INSERT INTO `notification_templates` (`id`, `business_id`, `template_for`, `email_body`, `sms_body`, `subject`, `auto_send`, `auto_send_sms`, `created_at`, `updated_at`) VALUES
(1, 1, 'new_sale', '<p>Dear {contact_name},</p>\r\n\r\n<p>Your invoice number is {invoice_number}<br />\r\nTotal amount: {total_amount}<br />\r\nPaid amount: {paid_amount}</p>\r\n\r\n<p>Thank you for shopping with us.</p>\r\n\r\n<p>{business_logo}</p>\r\n\r\n<p>&nbsp;</p>', 'Xin Chao {contact_name},  {business_name} Cam on ban da dat hang với ma dat hang {invoice_number}', 'Thank you from {business_name}', 1, 1, '2018-11-26 04:21:57', '2019-05-10 01:27:04'),
(2, 1, 'payment_received', '<p>Dear {contact_name},</p>\r\n\r\n<p>We have received a payment of {paid_amount}</p>\r\n\r\n<p>{business_logo}</p>', 'Dear {contact_name}, We have received a payment of {paid_amount}. {business_name}', 'Payment Received, from {business_name}', 0, 0, '2018-11-26 04:21:57', '2019-05-09 02:58:35'),
(3, 1, 'payment_reminder', '<p>Dear {contact_name},</p>\r\n\r\n<p>This is to remind you that you have pending payment of {due_amount}. Kindly pay it as soon as possible.</p>\r\n\r\n<p>{business_logo}</p>', 'Dear {contact_name}, You have pending payment of {due_amount}. Kindly pay it as soon as possible. {business_name}', 'Payment Reminder, from {business_name}', 0, 0, '2018-11-26 04:21:57', '2019-05-09 02:58:35'),
(4, 1, 'new_booking', '<p>Dear {contact_name},</p>\r\n\r\n<p>Your booking is confirmed</p>\r\n\r\n<p>Date: {start_time} to {end_time}</p>\r\n\r\n<p>Table: {table}</p>\r\n\r\n<p>Location: {location}</p>\r\n\r\n<p>{business_logo}</p>', 'Dear {contact_name}, Your booking is confirmed. Date: {start_time} to {end_time}, Table: {table}, Location: {location}', 'Booking Confirmed - {business_name}', 0, 0, '2018-11-26 04:21:57', '2019-05-09 02:58:35'),
(5, 1, 'new_order', '<p>Dear {contact_name},</p>\r\n\r\n<p>We have a new order with reference number {invoice_number}. Kindly process the products as soon as possible.</p>\r\n\r\n<p>{business_name}<br />\r\n{business_logo}</p>', 'Dear {contact_name}, We have a new order with reference number {invoice_number}. Kindly process the products as soon as possible. {business_name}', 'New Order, from {business_name}', 0, 0, '2018-11-26 04:21:57', '2019-05-09 02:58:35'),
(6, 1, 'payment_paid', '<p>Dear {contact_name},</p>\r\n\r\n<p>We have paid amount {paid_amount} again invoice number {invoice_number}.<br />\r\nKindly note it down.</p>\r\n\r\n<p>{business_name}<br />\r\n{business_logo}</p>', 'We have paid amount {paid_amount} again invoice number {invoice_number}.\r\n                    Kindly note it down. {business_name}', 'Payment Paid, from {business_name}', 0, 0, '2018-11-26 04:21:57', '2019-05-09 02:58:35'),
(7, 1, 'items_received', '<p>Dear {contact_name},</p>\r\n\r\n<p>We have received all items from invoice reference number {invoice_number}. Thank you for processing it.</p>\r\n\r\n<p>{business_name}<br />\r\n{business_logo}</p>', 'We have received all items from invoice reference number {invoice_number}. Thank you for processing it. {business_name}', 'Items received, from {business_name}', 0, 0, '2018-11-26 04:21:57', '2019-05-09 02:58:35'),
(8, 1, 'items_pending', '<p>Dear {contact_name},<br />\r\nThis is to remind you that we have not yet received some items from invoice reference number {invoice_number}. Please process it as soon as possible.</p>\r\n\r\n<p>{business_name}<br />\r\n{business_logo}</p>', 'This is to remind you that we have not yet received some items from invoice reference number {invoice_number} . Please process it as soon as possible.{business_name}', 'Items Pending, from {business_name}', 0, 0, '2018-11-26 04:21:57', '2019-05-09 02:58:35'),
(9, 2, 'new_sale', '<p>Dear {contact_name},</p>\n\n                    <p>Your invoice number is {invoice_number}<br />\n                    Total amount: {total_amount}<br />\n                    Paid amount: {paid_amount}</p>\n\n                    <p>Thank you for shopping with us.</p>\n\n                    <p>{business_logo}</p>\n\n                    <p>&nbsp;</p>', 'Dear {contact_name}, Thank you for shopping with us. {business_name}', 'Thank you from {business_name}', 0, 0, '2018-11-26 04:37:01', '2018-11-26 04:37:01'),
(10, 2, 'payment_received', '<p>Dear {contact_name},</p>\n\n                <p>We have received a payment of {paid_amount}</p>\n\n                <p>{business_logo}</p>', 'Dear {contact_name}, We have received a payment of {paid_amount}. {business_name}', 'Payment Received, from {business_name}', 0, 0, '2018-11-26 04:37:01', '2018-11-26 04:37:01'),
(11, 2, 'payment_reminder', '<p>Dear {contact_name},</p>\n\n                    <p>This is to remind you that you have pending payment of {due_amount}. Kindly pay it as soon as possible.</p>\n\n                    <p>{business_logo}</p>', 'Dear {contact_name}, You have pending payment of {due_amount}. Kindly pay it as soon as possible. {business_name}', 'Payment Reminder, from {business_name}', 0, 0, '2018-11-26 04:37:01', '2018-11-26 04:37:01'),
